import React, { useState, useEffect } from "react";
import { Row, Col, Card } from "react-materialize";
import { useStore } from "react-redux";
import axios from "axios";

const UserList = () => {
  const store = useStore(),
    [usersList, setUsersList] = useState([]),
    usersListHtml = [];

  useEffect(() => {
    console.log(store.getState().clickState.token);
    const loadUsers = async () => {
      const response = await axios.get(`https://reqres.in/api/users?delay=2`, {
        headers: {
          token: store.getState().clickState.token,
        },
      });
      setUsersList(response.data);
    };

    loadUsers();
  }, [store]);
  console.log(usersList);

  for (let i = 0; i < usersList.length; i++) {
    usersListHtml.push(
      <ul class="collection">
        <li class="collection-item">Alvin</li>
        <li class="collection-item">Alvin</li>
        <li class="collection-item">Alvin</li>
        <li class="collection-item">Alvin</li>
      </ul>
    );
  }

  return (
    <Row>
      <Col m={12} s={12}>
        <h5 className="subtitle">About Me</h5>
        <Card>
          <div>
            <p>
              <b>Lorem</b>
            </p>
            <p>
              "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
              eiusmod tempor incididunt ut laborevoluptate velit esse cillum
              dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat
              non proident, sunt in culpa qui officia deserunt mollit anim id
              est laborum."
            </p>
            <br />
            <p>
              <b>Ipsum</b>
            </p>
            <p>
              "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
              eiusmod tempor incididunt ut laborevoluptate velit esse cillum
              dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat
              non proident, sunt in culpa qui officia deserunt mollit anim id
              est laborum."
            </p>
          </div>
        </Card>
      </Col>
    </Row>
  );
};

export default UserList;
